import React from "react";
import Icon1 from "../../images/Icon-1.svg";
import Icon2 from "../../images/Icon-2.svg";
import Icon3 from "../../images/Icon-3.svg";
import {
  FaqContainer,
  FaqH1,
  FaqWrapper,
  FaqCard,
  FaqIcon,
  FaqP,
  FaqH2,
} from "./FaqElements";

const Faq = () => {
  return (
    <>
      <FaqContainer id="faq">
        <FaqH1>Întrebări frecvente</FaqH1>
        <FaqWrapper>
          <FaqCard>
            <FaqIcon src={Icon1} />
            <FaqH2>
              Verificarea online a punctele de penalizare acumulate pe carnet UK
            </FaqH2>
            <FaqP>
              Punctele de penalizare ale șoferilor cu carnet emis în UK pot fi
              verificate foarte simplu online!
              <a href="https://www.gov.uk/view-driving-licence"></a>
            </FaqP>
          </FaqCard>
          <FaqCard>
            <FaqIcon src={Icon2} />
            <FaqH2>Card2</FaqH2>
            <FaqP>Random text for each card</FaqP>
          </FaqCard>
          <FaqCard>
            <FaqIcon src={Icon3} />
            <FaqH2>Card3</FaqH2>
            <FaqP>Random text for each card</FaqP>
          </FaqCard>
        </FaqWrapper>
      </FaqContainer>
    </>
  );
};

export default Faq;
